import React from "react";
import { RulesRow } from "./RulesRow";
import {
  DataGridBody,
  DataGridRow,
  DataGrid,
  DataGridHeader,
  DataGridHeaderCell,
  DataGridCell,
  TableCellLayout,
  TableColumnDefinition,
  createTableColumn,
  Tooltip,
  Button
} from "@fluentui/react-components";
import {
  Info16Regular
} from "@fluentui/react-icons";
import { makeStyles } from "@fluentui/react-components";
import {techniqueDescriptions} from "./techniques"

const useStyles = makeStyles({
  root: { color: "black" },
});

export const RulesTable = (props: any) => {
  var selectedRows: any;
  const classes = useStyles();

  type ID = {
    label: string
  };

  type Status = {
    label: string
  };

  type Severity = {
    label: string;
    icon: JSX.Element;
  };

  type InUse = {
    label: string
  }

  type Name = {
    label: string;
  };

  type RuleType = {
    label: string;
    icon: JSX.Element;
  };

  type DataSources = {
    label: string;
  };

  type Tactics = {
    label: string;
    icon: JSX.Element[];
  };

  type Techniques = {
    label: JSX.Element;
  };

  type SourceName = {
    label: string;
  };

  //This is a list of all the fields that make up an individual item
  type Item = {
    severity: Severity;
    status: Status;
    id: ID;
    inUse: InUse;
    name: Name;
    ruleType: RuleType;
    dataSources: DataSources;
    tactics: Tactics;
    techniques: Techniques;
    sourceName: SourceName;
  };

  //Get the color that represents the severity
  function getSeverityColor(severity: string) {
    var sentinelColorSeverityClass: JSX.Element = <div></div>;
    switch (severity) {
      case "High":
        sentinelColorSeverityClass = <div className="colorSeverityClassHigh">&nbsp;</div>
        break;
      case "Medium":
        sentinelColorSeverityClass = <div className="colorSeverityClassMedium">&nbsp;</div>
        break;
      case "Low":
        sentinelColorSeverityClass = <div className="colorSeverityClassLow">&nbsp;</div>
        break;
      case "Informational":
        sentinelColorSeverityClass = <div className="colorSeverityClassInformational">&nbsp;</div>
        break;
      default:
        break;
    }
    return sentinelColorSeverityClass;
  }

  //Get the image that represents the rule types
  function getRuleImage(kind: string) {
    var kindImage: JSX.Element = <strong />;
    switch (kind) {
      case "scheduled":
      case "Scheduled":
        kindImage = <img src="data:image/svg+xml;base64," alt="" ></img>
        break;
      case "NRT":
        kindImage = <img src="data:image/svg+xml;base64," alt="" ></img>
        break;
      case "Fusion":
        kindImage = <img src="data:image/svg+xml;base64," alt="" ></img>
        break;
      case "MicrosoftSecurityIncidentCreation":
        kindImage = <img src="data:image/svg+xml;base64," alt="" ></img>
        break;
      case "MLBehaviorAnalytics":
        kindImage = <img src="data:image/svg+xml;base64," alt="" className="ruleTypeImage"></img>
        break;
      case "ThreatIntelligence":
        kindImage = <img src="data:image/svg+xml;base64," alt="" ></img>
        break;
      default:
        break;
    }
    return kindImage
  }

  //Translate some of the rule type names
  function translateRuleType(kind: string) {
    var translatedRuleType: string = kind[0].toUpperCase() + kind.substring(1);
    switch (kind) {
      case "MicrosoftSecurityIncidentCreation":
        translatedRuleType = "Microsoft Security";
        break;
      case "MLBehaviorAnalytics":
        translatedRuleType = "ML Behavior Analytics";
        break;
      case "ThreatIntelligence":
        translatedRuleType = "Threat Intelligence";
        break;
      default:
        break;
    }
    return translatedRuleType
  }

  //This is a placeholder function that can be called when a rule is selected
  function switchBackground(data: any) {
    selectedRows = data;
  }

  //Determine what data source this rule template is coming from
  function getDataSource(source: any) {
    var dataSource: string = "Gallery"
    if (source !== undefined) {
      dataSource = source.name;
      if (dataSource !== "SAP") {
        dataSource = dataSource.replace(/([A-Z])/g, ' $1').trim()
      }
    }
    return dataSource
  }

  //Check to see if this template is being used.  
  //***NOT FINISHED */
  function isRuleTemplateInUse(row: any) {
    var inUse: string = "";
    if ((row.properties.alertRulesCreatedByTemplateCount !== undefined) && (row.properties.alertRulesCreatedByTemplateCount !== 0)) {
      inUse = "In Use";
    }
    return inUse;
  }

  //Load the images used for tactics along with their name as a tooltip
  function getTacticsImages(tactics: any) {
    var returnValue: JSX.Element[] = [<strong />]
    if (tactics !== undefined) {
      for (var index: number = 0; index < tactics.length; index++) {
        switch (tactics[index]) {
          case "Collection":
            returnValue.push(<Tooltip content="Collection" relationship="label"><img src="data:image/svg+xml;base64," alt=""></img></Tooltip>);
            break;
          case "CommandAndControl":
            returnValue.push(<Tooltip content="Command and Control" relationship="label"><img src="data:image/svg+xml;base64," alt=""></img></Tooltip>)
            break;
          case "CredentialAccess":
            returnValue.push(<Tooltip content="Credential Access" relationship="label"><img src="data:image/svg+xml;base64," alt=""></img></Tooltip>);
            break;
          case "DefenseEvasion":
            returnValue.push(<Tooltip content="Defense Evasion" relationship="label"><img src="data:image/svg+xml;base64," alt=""></img></Tooltip>);
            break;
          case "Discovery":
            returnValue.push(<Tooltip content="Discovery" relationship="label"><img src="data:image/svg+xml;base64," alt=""></img></Tooltip>)
            break;
          case "Execution":
            returnValue.push(<Tooltip content="Execution" relationship="label"><img src="data:image/svg+xml;base64," alt=""></img></Tooltip>);
            break;
          case "Exfiltration":
            returnValue.push(<Tooltip content="Exfiltration" relationship="label"><img src="data:image/svg+xml;base64," alt=""></img></Tooltip>);
            break;
          case "Impact":
            returnValue.push(<Tooltip content="Impact" relationship="label"><img src="data:image/svg+xml;base64," alt=""></img></Tooltip>);
            break;
          case "ImpairProcessControl":
            returnValue.push(<Tooltip content="Impair Process Control" relationship="label"><img src="data:image/svg+xml;base64," alt=""></img></Tooltip>);
            break;
          case "InhibitResponseFunction":
            returnValue.push(<Tooltip content="Inhibit Response Function" relationship="label"><img src="data:image/svg+xml;base64," alt=""></img></Tooltip>);
            break;
          case "InitialAccess":
            returnValue.push(<Tooltip content="Initial Access" relationship="label"><img src="data:image/svg+xml;base64," alt=""></img></Tooltip>);
            break;
          case "LateralMovement":
            returnValue.push(<Tooltip content="Lateral Movement" relationship="label"><img src="data:image/svg+xml;base64," alt=""></img></Tooltip>);
            break;
          case "Persistence":
            returnValue.push(<Tooltip content="Persistence" relationship="label"><img src="data:image/svg+xml;base64," alt=""></img></Tooltip>);
            break;
          case "PrivilegeEscalation":
            returnValue.push(<Tooltip content="Privilege Escalation" relationship="label"><img src="data:image/svg+xml;base64," alt=""></img></Tooltip>);
            break;
          case "Reconnaissance":
            returnValue.push(<Tooltip content="Reconnaissance" relationship="label"><img src="data:image/svg+xml;base64," alt="" ></img></Tooltip>);
            break;
          case "ResourceDevelopment":
            returnValue.push(<Tooltip content="Resource Development" relationship="label"><img src="data:image/svg+xml;base64," alt=""></img></Tooltip>);
            break;

          default:
            break;
        }
      }
    }
    return returnValue;
  }

  //Create a tooltip for all of the techniques being used
  function loadTechniques(techniques: string) {
    var returnValue: JSX.Element = <strong />
    var techniquesCount: number = 0;

    if (techniques !== undefined) {
      returnValue = <span><Tooltip content={techniqueDescriptions.data[techniques[0]].description} relationship="label" {...props}><span>{techniques[0]}</span></Tooltip></span>;
      if (techniques.length > 1) {
          techniquesCount = techniques.length-1;
          var toolTipText:JSX.Element[]=[<strong/>];
          for (var index:number=1; index<techniques.length; index++)
          {
            var techinqueText:string = techniques[index];
               toolTipText.push(<span>{techinqueText}&nbsp;&nbsp;{techniqueDescriptions.data[techinqueText].description}<br/></span>);          }
          returnValue = <span><Tooltip content={techniqueDescriptions.data[techniques[0]].description} relationship="label" {...props}><span>{techniques[0]}</span></Tooltip>&nbsp;+{techniquesCount}<Tooltip content={toolTipText} relationship="label" {...props}><Button icon={<Info16Regular />} size="small" appearance="transparent"/></Tooltip></span>;
      }
      
    }

    return returnValue;
  }

  //Load the items array used to display the data
  const items: Item[] = [];
  props.sentinelData.map((row: any, i: number) => {
    var thisSeverity = row.properties.severity;
    if (thisSeverity === undefined) {
      thisSeverity = "High";
    }
    var item: Item = {
      id: { label: row.name },
      severity: { label: thisSeverity, icon: getSeverityColor(thisSeverity) },
      status: { label: "" },
      inUse: { label: isRuleTemplateInUse(row) },
      name: { label: row.properties.displayName },
      ruleType: { label: translateRuleType(row.kind), icon: getRuleImage(row.kind) },
      dataSources: { label: getDataSource(row.source) },
      tactics: { label: "", icon: getTacticsImages(row.properties.tactics) },
      techniques: { label: loadTechniques(row.properties.techniques) },
      sourceName: { label: "Gallery" },
    };
    items.push(item);
  });

  //Define all the individual display columns
  const columns: TableColumnDefinition<Item>[] = [
    createTableColumn<Item>({
      columnId: "severity",
      compare: (a, b) => {
        return a.severity.label.localeCompare(b.severity.label);
      },
      renderHeaderCell: () => {
        return "Severity";
      },
      renderCell: (item) => {
        return <TableCellLayout media={item.severity.icon}>{item.severity.label}</TableCellLayout>;
      },
    }),
    createTableColumn<Item>({
      columnId: "inuse",
      compare: (a, b) => {
        return a.inUse.label.localeCompare(b.inUse.label);
      },
      renderHeaderCell: () => {
        return "In Use";
      },
      renderCell: (item) => {
        return <TableCellLayout className="inUse">{item.inUse.label}</TableCellLayout>;
      },
    }),
    createTableColumn<Item>({
      columnId: "name",
      compare: (a, b) => {
        return a.name.label.localeCompare(b.name.label);
      },
      renderHeaderCell: () => {
        return "Name";
      },
      renderCell: (item) => {
        return <TableCellLayout truncate>{item.name.label}</TableCellLayout>;
      },
    }),
    createTableColumn<Item>({
      columnId: "ruleType",
      compare: (a, b) => {
        return a.ruleType.label.localeCompare(b.ruleType.label);
      },
      renderHeaderCell: () => {
        return "Rule Type";
      },
      renderCell: (item) => {
        return <TableCellLayout media={item.ruleType.icon}>{item.ruleType.label}</TableCellLayout>;
      },
    }),
    createTableColumn<Item>({
      columnId: "dataSources",
      compare: (a, b) => {
        return a.dataSources.label.localeCompare(b.dataSources.label);
      },
      renderHeaderCell: () => {
        return "Source Name";
      },
      renderCell: (item) => {
        return <TableCellLayout truncate>{item.dataSources.label}</TableCellLayout>;
      },
    }),
    createTableColumn<Item>({
      columnId: "tactics",
      // compare: (a, b) => {
      //   return a.tactics.label.localeCompare(b.tactics.label);
      // },
      renderHeaderCell: () => {
        return "Tactics";
      },
      renderCell: (item) => {
        return <TableCellLayout media={item.tactics.icon}>{item.tactics.label}</TableCellLayout>;
      },
    }),
    createTableColumn<Item>({
      columnId: "techniques",
      /* compare: (a, b) => {
        return a.techniques.label.localeCompare(b.techniques.label);
      } */
      renderHeaderCell: () => {
        return "Techniques";
      },
      renderCell: (item) => {
        return <TableCellLayout>{item.techniques.label}</TableCellLayout>;
      },
    }),
    createTableColumn<Item>({
      columnId: "status",
      compare: (a, b) => {
        return a.status.label.localeCompare(b.status.label);
      },
      renderHeaderCell: () => {
        return "Status";
      },
      renderCell: (item) => {
        return <TableCellLayout >{item.status.label}</TableCellLayout>;
      },
    }),
  ];

  //Create the datagrid and return it
  return (
    <>
      <DataGrid
        items={items}
        columns={columns}
        sortable
        selectionMode="multiselect"
        getRowId={(item) => item.id.label}
        onSelectionChange={(e, data) => switchBackground(data)}
        className={classes.root}
        resizableColumns
        id="ruleTemplateGrid"
        columnSizingOptions={{
          severity: {
            minWidth: 70,
            defaultWidth: 80
          },
          inuse: {
            minWidth: 70,
            defaultWidth: 80,
          },
          name: {
            minWidth: 100,
            defaultWidth: 400
          }
        }}
      >
        <DataGridHeader>
          <DataGridRow selectionCell={{ "aria-label": "Select all rows" }}>
            {({ renderHeaderCell }) => (
              <DataGridHeaderCell>{renderHeaderCell()}</DataGridHeaderCell>
            )}
          </DataGridRow>
        </DataGridHeader>
        <DataGridBody<Item>>
          {({ item, rowId }) => (
            <DataGridRow<Item> key={rowId} selectionCell={{ "aria-label": "Select row" }} >
              {({ renderCell }) => (
                <DataGridCell>{renderCell(item)}</DataGridCell>
              )}
            </DataGridRow>
          )}
        </DataGridBody>
      </DataGrid>
    </>
  );
};
